import React from "react";
import Cards from "./components/Cards";
import "./App.css";

function App() {
  return (
    <>
      <div>
        <h1>Covid-19 Tracker</h1>
      </div>
      <div>
        <Cards text={"Hello"} />
      </div>
    </>
  );
}

export default App;
